const stripeCheckout=function(e){wp.hooks.addAction("wu_on_form_success","nextpress/wp-ultimo",(async function(t,o){if("stripe-checkout"===t.gateway&&"free"!==o.gateway.slug){(await Stripe(e)).redirectToCheckout({sessionId:o.gateway.data.stripe_session_id}).then((function(e){e.error&&(console.log(e.error.message),document.getElementById("error-message").textContent=e.error.message)}))}}))};wp.hooks.addAction("wu_checkout_loaded","nextpress/wp-ultimo",(function(){var e;e=wu_stripe_checkout.pk_key,wp.hooks.addAction("wu_on_form_success","nextpress/wp-ultimo",(async function(t,o){"stripe-checkout"===t.gateway&&"free"!==o.gateway.slug&&(await Stripe(e)).redirectToCheckout({sessionId:o.gateway.data.stripe_session_id}).then((function(e){e.error&&(console.log(e.error.message),document.getElementById("error-message").textContent=e.error.message)}))}))}));